import { makeStyles } from "@material-ui/core";

const homePageStyles = makeStyles({
  root: {
    width: "80vw",
    height: "70vh",
    position: "absolute",
    top: "50%",
    left: "50%",
    transform: "translate(-50%,-50%)",
    overflow: "auto",
  },
  tableBody: {
    "&:nth-child(even) tr:nth-child(odd)": {
      backgroundColor: "#EFFFFD",
    },
  },
  tableRow: {
    border: "none",
  },
});

export default homePageStyles;
